import { ApolloClient, InMemoryCache, ApolloProvider, useQuery, gql } from '@apollo/client'

const CURRENCIES_QUERY = gql`
  query GetCurrencies {
    currencies {
        label
        symbol
    }
  }
`;

export default CURRENCIES_QUERY
